é podmínky nebudou vráceny.','Sort ascending or descending.'=>'Seřadit vzestupně nebo sestupně.','Coupon does not exist in the cart.'=>'Kupón v košíku neexistuje.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kupón nelze odebrat, protože ještě není použit v košíku.','Unique identifier for the coupon within the cart.'=>'Jedinečný identifikátor kupónu v košíku.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Omezit sadu výsledků produktů na základě maximální ceny poskytované za použití nejmenší jednotky měny.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Omezit sadu výsledků na produkty na základě minimální ceny poskytované za použití nejmenší jednotky měny.','Customer ID if registered. Will return 0 for guests.'=>'ID zákazníka, pokud je zaregistrován. Pro hosty vrátí 0.','Note added to the order by the customer during checkout.'=>'Poznámka přidaná k objednávce zákazníkem při placení.','Order key used to check validity or protect access to certain order data.'=>'Klíč objednávky používaný ke kontrole platnosti nebo ochraně přístupu k určitým údajům objednávky.','Order status. Payment providers will update this value after payment.'=>'Stav objednávky. Poskytovatelé plateb tuto hodnotu po zaplacení aktualizují.','The order ID to process during checkout.'=>'ID objednávky ke zpracování během placení.','Cart item is invalid.'=>'Položka košíku je neplatná.','Invalid coupons were removed from the cart: "%s"'=>'Z košíku byly odstraněny neplatné kupóny: "%s"','Cannot create order from empty cart.'=>'Nelze vytvořit objednávku z prázdného košíku.','The chosen rate ID for the package.'=>'Zvolené ID sazby pro balíček.','Limit result set to reviews from specific product IDs.'=>'Omezit sadu výsledků na recenze z konkrétních ID produktů.','Limit result set to reviews from specific category IDs.'=>'Omezit sadu výsledků na recenze z ID konkrétní kategorie.','Price string formatted as HTML.'=>'Cenový řetězec naformátovaný jako HTML.','Price data provided using the smallest unit of the currency.'=>'Údaje o ceně poskytované s použitím nejmenší jednotky měny.','Product full description in HTML format.'=>'Celý popis produktu ve formátu HTML.','Product short description in HTML format.'=>'Krátký popis produktu ve formátu HTML.','ID of the parent product, if applicable.'=>'ID nadřazeného produktu, je-li k dispozici.','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; není možné zakoupit.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kupón "%1$s" byl odstraněn z Vašeho košíku: %2$s','Coupon code "%s" has already been applied.'=>'Kód kupónu "%s" již byl použit.','List of variation IDs, if applicable.'=>'Seznam ID variant, je-li k dispozici.','Parent term ID, if applicable.'=>'ID nadřazeného výrazu, je-li k dispozici.','Quantity left in stock if stock is low, or null if not applicable.'=>'Množství ponechané na skladě, pokud je skladem, nebo nulové, pokud není použitelné.','The %s payment gateway is not available.'=>'Platební brána %s není k dispozici.','Collect and validate EU VAT numbers at checkout'=>'Uložit a zkontrolovat DIČ na pokladně','Verify database'=>'Ověřit databázi','Clear template cache'=>'Vymazat mezipaměť šablony','This tool will empty the template cache.'=>'Tento nástroj vyprázdní mezipaměť šablony.','Verify base database tables'=>'Ověřit základní tabulky databáze','Verify if all base database tables are present.'=>'Ověří, zda jsou přítomny všechny základní databázové tabulky.','First order received'=>'První přijatá objednávka','Database verified successfully.'=>'Databáze úspěšně ověřena.','Invalid category ID.'=>'Neplatné ID kategorie.','Remove legacy coupon menu'=>'Odstranit z menu původní položku Slevové kupóny','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Kupóny lze nyní spravovat v Marketing > Kupóny. Pro odstranění původní položky menu WooCommerce > Slevové kupóny klikněte na tlačítko níže.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maximální počet položek, které mají být vráceny v sadě výsledků. Výchozí nastavení je bez omezení, pokud je ponecháno prázdné.','You need WooCommerce 4.2 or newer to run this tool.'=>'Ke spuštění tohoto nástroje potřebujete WooCommerce 4.2 nebo novější.','Verifying database... One or more tables are still missing: '=>'Ověření databáze... Jedna nebo více tabulek stále chybí:','Template cache cleared.'=>'Mezipaměť šablon vymazána.','The active version of WooCommerce does not support template cache clearing.'=>'Aktivní verze WooCommerce nepodporuje čištění mezipaměti šablon.','Get real-time order alerts anywhere'=>'Získejte upozornění na objednávky v reálném čase kdekoli','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Získejte oznámení o aktivitě obchodu, včetně nových objednávek a recenzí produktů přímo na mobilních zařízeních s aplikací Woo.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Pokud váš obchod sídlí v EU, doporučujeme kromě automatických daní použít také rozšíření o DIČ pro EU. Poskytuje vaši pokladnu s polem pro shromažďování a ověřování DIČ zákazníka v EU, pokud ho má.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s vytvoření tabulky se nezdařilo. Má uživatel %2$s oprávnění tvořit v databázi %3$s?','Coupon management has moved!'=>'Správa kupónů přesunuta!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Tento videonávod Vám pomůže projít 