ef="%2$s">Znovu zkontrolovat.</a>','Missing base tables: %s. Some WooCommerce functionality may not work as expected.'=>'Chybějící základní tabulky: %s. Některé funkce WooCommerce nemusí fungovat podle očekávání.','Marketplace'=>'Tržiště','Import / Export'=>'Import / Export','Overview'=>'Přehled','Home'=>'Domů','Utilities'=>'Utility','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Provádějte platby s poskytovatelem, který je pro Vás ten pravý - vyberte si z více než 100 platebních bran pro WooCommerce.','Install plugins'=>'Nainstalovat pluginy','Start accepting payments on your store!'=>'Začněte přijímat platby ve svém obchodě!','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Všimli jsme si, že během instalace Jetpack a WooCommerce Doprava & Daň došlo k problému. Zkuste to prosím znovu a využijte všech výhod připojení pluginů k Vašemu obchodu! Omluvám se za nepříjemnost. Pluginy „Jetpack“ a „WooCommerce Doprava & Daň“ budou nainstalovány a aktivovány zdarma.','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Uh oh... Během instalace Jetpack a WooCommerce Doprava & Daň došlo k problému. Prosím zkuste to znovu.','Gaza'=>'Gaza','Volta'=>'Volta','Savannah'=>'Savannah','Bono East'=>'Bono východní','Bono'=>'Bono','Brong-Ahafo'=>'Brong-Ahafo','Ashanti'=>'Ashanti','Ahafo'=>'Ahafo','Cabo Delgado'=>'Cabo Delgado','Greater Accra'=>'Greater Accra','Inhambane'=>'Inhambane','Manica'=>'Manica','Maputo'=>'Maputo','Maputo Province'=>'Maputo Province','Nampula'=>'Nampula','Niassa'=>'Niassa','North East'=>'North East','Oti'=>'Oti','Sofala'=>'Sofala','Tete'=>'Tete','Upper East'=>'Upper East','Upper West