ed?'=>'Mají být osobní údaje v rámci objednávek při %s zachovány nebo odstraněny?','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Zadejte číslo pro nastavení množství zásob na úrovni variant produktu. Použijte  zaškrtávací políčko \'Správa zásob\' u variant pro povolit / zakázat správu zásob na úrovni variant.','ShipStation'=>'ShipStation','Which product category should be exported?'=>'Která kategorie produktů má být vyexportována?','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Vaše šablona (%s) obsahuje zastaralé kopie některých souborů WooCommerce.</strong> Tyto soubory mohou potřebovat aktualizaci, aby byly kompatibilní s aktuální verzí WooCommerce. Návrhy k vyřešení:','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Doporučujeme používat službu ShipStation, která vám ušetří čas na poště tím, že si můžete vytisknout své přepravní štítky doma. Vyzkoušejte ShipStation na 30 dnů zdarma.','Set up PayPal for me using this email:'=>'Nastavte PayPal e-mail:','Set up Stripe for me using this email:'=>'Nastavte Stripe e-mail:','Item moved up'=>'Položka přesunuta výše','Item moved down'=>'Položka přesunuta níže','You may need to manually restore the item\'s stock.'=>'Možná budete muset ručně obnovit skladové zásoby.','Are you sure you want to remove the selected items?'=>'Opravdu chcete odstranit vybrané položky?','Meters'=>'Metry','Ounces'=>'Unce','Pounds'=>'Libry','Grams'=>'Gramy','Yards'=>'Yardy','Inches'=>'Palce','Millimeters'=>'Milimetry','Centimeters'=>'Centimetry','Alto Paraguay'=>'Alto Paraguay','Presidente Hayes'=>'Prezident Hayes','Amambay'=>'Amambay','Central'