ll be how your name will be displayed in the account section and in reviews'=>'Tímto způsobem se bude zobrazovat vaše jméno ve vašem účtu a v komentářích','Other locations'=>'Další lokace','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Jakákoliv &quot;%1$s&quot; metoda','Required'=>'Povinné','%s field'=>'%s pole','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Více informací najdete na <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> .','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal standartně přesměrovává zákazníky na Paypal k doplnění jejich informací k platbě.','%s page'=>'%s strana','Highlight required fields with an asterisk'=>'Povinná pole označit hvězdičkou','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Přijímejte platby osobně prostřednictvím šeků. Tato online brána může být rovněž užitečná pro testování objednávek.','No page set'=>'Nebyla nastavena žádná stránka','These options let you change the appearance of the WooCommerce checkout.'=>'Tato nastavení umožňují změnu vzhledu WooCommerce pokladny.','Account details:'=>'Detaily účtu:','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'about,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Přidá text pro checkbox s podmínkami, které musí zákazník při objednávce odsouhlasit.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Přijímáme platby přes PayPal . Při zpracování platby budou některé vaše údaje předány službě PayPal, včetně informací potřebných pro zpracování nebo podpoře platby, jako jsou informace o celkové částce prodeje nebo fakturační údaje.','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Zaznamenávejte PayPal případy jako IPN požadavky uvnitř %s. Poznámka: Toto může zaznamenávat i osobní informace. Doporučujeme používat pouze pro účely ladění chyb a smazat veškeré záznamy, jakmile bude dokončeno.','I have read and agree to the website %s'=>'Přečetl/a jsem si %s a souhlasím s&nbsp;nimi','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Přijímejte platby pomocí metody BACS, známé také jako bankovní převod.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'V tomto pododdíle by měly být uvedeny platební procesory třetích stran, které používáte k uskutečňování plateb ve vašem e-shopu, protože mohou zpracovávat osobní údaje zákazníka. Je zahrnut například PayPal, ale měli byste ho odstranit, pokud ho nepoužíváte.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'V tomto oddíle by mělo být uvedeno, s kým sdílíte údaje a za jakým účelem. To může obsahovat, ale ne být omezeno na analýzy, marketing, platební brány, poskytovatele přepravy a vkládání třetích stran.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Sdílíme informace s třetími stranami, které nám pomáhají při zpracování vašich objednávek a námi poskytovaných služeb, například --','What we share with others'=>'Co sdílíme s ostatními','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informace o objednávce, jako jsou co bylo zakoupeno, kdy to bylo zakoupeno a kam by mělo být zboží zasláno, a','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'K informacím, které nám poskytnete, mají přístup členové našeho týmu. Například jak Administrátoři, tak Manažeři obchodu mají přístup k:','Who on our team has access'=>'Kdo z našeho týmu má přístup','We will also store comments or reviews, if you choose to leave them.'=>'Budeme rovněž uchovávat komentáře či recenze, pokud se je rozhodnete zveřejnit.','Customer information like your name, email address, and billing and shipping information.'=>'Informace o zákazníkovi jako jsou vaše jméno, e-mailová adresa, fakturační a doručovací adresa.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Členové našeho týmu mají přístup k těmto informacím, aby pomohli zpracovávat objednávky, refundace a poskytovali podporu zákazníkům.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Vaše informace obvykle ukládáme po dobu, po kterou je potřebujeme k účelům, pro které je sbíráme a používáme, dokud jsme povinni je uchovávat. Například informace o objednávce uchováváme po dobu XXX let pro daňové a účetní účely. Tyto údaje zahrnují Vaše jméno, e-mail, fakturační a doručovací adresu.','Respond to your requests, including refunds and complaints'=>'Odpovědět na vaše požadavky včetně vrácení peněz a reklamací','Process payments and prevent fraud'=>'Zpracovat platbu a předejít podvodům','Set up your account for our store'=>'Nastavit váš účet v našem obchodě','Send you information about your account and order'=>'Zaslat informace o vašem účtu a objednávce','Send you marketing messages, if you choose to receive them'=>'Zasílat marketingové zprávy v případě, že se je rozhodnete odebírat','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Pokud vytvoříte účet, uložíme vaše jméno, adresu, e-mail a telefonní číslo, které budou použity v budoucnu pro vyplnění stránky pokladny.','Improve our store offerings'=>'Zlepšovat nabídku našeho obchodu','Comply with any legal obligations we have, such as calculating taxes'=>'Dodržovat veškeré zákonné povinnosti, které se na nás vztahují, například výpočet daní','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Pokud u nás budete nakupovat, vyžádáme si od Vás informace, jako jsou Vaše jméno, fakturační adresa, doručovací adresa, e-mailová adresa, telefonní číslo, kreditní karta/platební údaje a také volitelné informace o Vašem účtu, jako jsou uživatelské jméno a heslo. Tyto informace budou použity, abychom mohli např.:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Poznámka: Možná budete chtít podrobněji upřesnit zásady cookie a odkazovat na tuto sekci.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Soubory cookie také používáme k zapamatování obsahu košíku při procházení našich stránek.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adresa dodání: O zadání tohoto údaje Vás žádáme z důvodu předběžné kalkulace ceny za dopravu dříve, než vytvoříte objednávku a bude Vám zasláno zboží!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokace, IP adresa a typ prohlížeče: tyto údaje používáme např. pro spočítání daní a poštovného','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Již zobrazené produkty: tyto informace můžeme použít k zobrazení již prohlédnutých produktů','What we collect and store'=>'Jaká data sbíráme a uchováváme','We collect information about you during the checkout process on our store.'=>'Sbíráme o Vás informace během procesu dokončení objednávky na našem e-shopu.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Tato část textu obsahuje základní informace o osobních údajích, které shromažďujete. Avšak na základě toho, jaká nastavení a pluginy používáte, se mohou shromažďované informace lišit. Doporučujeme konzultovat s&nbsp;právníkem rozhodnutí, které informace uvádět v&nbsp;zásadách ochrany osobních údajů.','While you visit our site, we’ll track:'=>'Během návštěvy našeho webu budeme sledovat:','Items Purchased'=>'Zakoupené položky','Order Number'=>'Číslo objednávky','Access granted'=>'Přístup povolen','Download count'=>'Počet stažení','Browser User Agent'=>'Hlavička webového prohlížeče','Token'=>'Token','Payment Tokens'=>'Platební tokeny','User email'=>'E-mail uživatele','Personal data removed.'=>'Osobní data odstraněna.','Shipping State'=>'S